;; gorilla-repl.fileformat = 1

;; **
;;; # Single-objective symbolic regression
;;; 
;;; This worksheet demonstrates how to run a symbolic regression with a basic tournament selection GA.
;; **

;; @@
(ns algebolic.demo.single-sr
  (:require [gorilla-plot.core :as plot]
            [algebolic.expression.core :as expression]
            [algebolic.expression.tree :as tree]
            [algebolic.expression.genetics :as genetics]
            [algebolic.expression.score :as score]
            [darwin.evolution.core :as evolution]
            [darwin.evolution.metrics :as metrics]
            [darwin.evolution.reproduction :as reproduction]
            [darwin.evolution.scoring :as scoring]
            [darwin.evolution.selection :as selection]
            [darwin.evolution.transform :as transform]
            [darwin.algorithms.sso :as sso]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; Generate some data to fit.
;; **

;; @@
(def xs (range 0.0 10.0 1.0))
(def coords (mapv (fn [x] [x]) xs))
(def data (mapv (fn [x] (+ (* 2 x) (* 3 x x))) xs))
(def vars '[x])
(def functions (expression/get-functions #{:plus :times :minus}))
(def terminals (expression/terminal-generators vars))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;algebolic.demo.single-sr/terminals</span>","value":"#'algebolic.demo.single-sr/terminals"}
;; <=

;; **
;;; Here we explicitly build the `generation-config` which lets us control every aspect of the run. The namespaces are fairly well commented, and I would recommend looking through their code to understand what is possible.
;; **

;; @@
(def generation-config
  (let [size-limit 60
        min-size 5
        ea-config (sso/sso-ea-config
                    {:tournament-size 5
                     :goal :error
                     :binary-ops [{:op (partial genetics/ninety-ten-sl-crossover size-limit) :repeat 45}]
                     :unary-ops [{:op (partial genetics/random-tree-mutation functions terminals 5) :repeat 5}
                                 {:op identity :repeat 5}]})
        score-functions {:complexity tree/count-nodes
                         :error (fn [ex] (score/abs-error vars coords data ex))
                         :error-pp (fn [ex] (score/abs-error-pp vars coords data 5 ex))}]
    {:ea-config              ea-config
     :transformations        [(partial transform/apply-to-fraction-of-genotypes
                                       (partial transform/hill-descent
                                                genetics/twiddle-constants
                                                (:error score-functions))
                                       0.2)
                                       (partial transform/apply-to-all-genotypes
                                                (partial genetics/trim-hard size-limit))
                                       (partial transform/apply-to-all-genotypes
                                                (partial genetics/boost-hard min-size
                                                         #(genetics/random-full-tree functions terminals 3)))]
                                       :score-functions        score-functions
                                       :reporting-function     (fn [z] (print ".") (flush))}))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;algebolic.demo.single-sr/generation-config</span>","value":"#'algebolic.demo.single-sr/generation-config"}
;; <=

;; **
;;; We use Koza's "ramped half-and-half" initialisation method.
;; **

;; @@
(def initial-zg
  (evolution/make-zeitgeist (genetics/ramped-half-and-half-population functions terminals 100 6)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;algebolic.demo.single-sr/initial-zg</span>","value":"#'algebolic.demo.single-sr/initial-zg"}
;; <=

;; **
;;; Run for a few generations.
;; **

;; @@
(time (def result (evolution/run-evolution generation-config initial-zg (fn [zg gc] (>= (:age zg) 150)))))
;; @@
;; ->
;;; ......................................................................................................................................................&quot;Elapsed time: 3330.323282 msecs&quot;
;;; 
;; <-
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;algebolic.demo.single-sr/result</span>","value":"#'algebolic.demo.single-sr/result"}
;; <=

;; **
;;; We can look at the maximum error in each generation.
;; **

;; @@
(plot/list-plot (:min (:error @metrics/metrics)) :joined true)
